class historiapanel extends HTMLElement {
    constructor(){
        super();
    }

    connectedCallback(){
        this.innerHTML = `
        <nav class="historia-panel" id="historia-panel">
            <div class = "container">
                <div class = "columna">
                    <p>Aula magna se concebio como expresión de las jerarquías existentes en la comunidad universitaria, de allí que se definieran accesos relevantes de la platea al escenario, punto de contacto entre el graduando y su ascenso al nivel de la auctoritas académica para el conferimiento del grado.</p>
                    <img class="img-histo" src="data:image/jpeg;base64," alt="URU"/>
                    <p>El escenario, en este caso, es el área que ocupa la totalidad del cuerpo académico, siempre presidido por el Rector. La investidura de la toga y el birrete simboliza el acceso del graduando a una jerarquía superior como titulado.</p>
                </div>
                <div class = "columna">
                    <p>Desde los inicios de la Universidad Rafael Urdaneta, el servicio de la Biblioteca ha estado presente como apoyo fundamental en el funcionamiento académico, principalmente en las áreas de docencia e investigación.</p>
                    <img class="img-histo" src="data:image/jpeg;base64," alt="URU"/>
                    <p>Por este motivo y para afianzar el rol de la Biblioteca, se construyó una nueva sede, la cual se puso en funcionamiento en mayo del 2006. Este nuevo edificio representó cambios significativos no sólo a nivel de las instalaciones sino también en la estructura y apertura de nuevos servicios disponibles para la comunidad URU.</p>
                </div>
            </div>
        </nav> 
        `
    }
}

window.customElements.define("historia-panel", historiapanel);